		handle: function(handle) {
			if (handle === undefined) {
				return this.options.handle;
			}
			this.options.handle = handle;
		},

		angle: function(angle) {
			if (angle === undefined) {
				return this.options.angle;
			}
			this.options.angle = angle;
			this.performRotation(this.options.angle);
		},
